import React from "react";
import "./info.css";

const Info = () => {
  return (
    <form>
      <fieldset>
        <legend>Login</legend>
        <div className="username">
          <label for="username">Username : </label>
        </div>
        <div className="username">
          <label for="username">Password : </label>
        </div>
      </fieldset>
    </form>
  );
};

export default Info;
